public static boolean verifyCheckSum(byte[] header) {
    long storedSum = 0;
    long unsignedSum = 0;
    long signedSum = 0;

    int digits = 0;
    boolean foundNullSpace = false;
    for (int i = 0; i < header.length; i++) {
        byte b = header[i];
        if (CHKSUM_OFFSET <= i && i < CHKSUM_OFFSET + CHKSUMLEN) {
            if ('0' <= b && b <= '7' && !foundNullSpace) {
                storedSum = storedSum * 8 + b - '0';
                digits++;
            } else if (digits > 0) {
                foundNullSpace = true;
            }
            b = ' ';
        }
        unsignedSum += 0xff & b;
        signedSum += b;
    }
    return storedSum == unsignedSum || storedSum == signedSum;
}

public static boolean verifyCheckSum(byte[] header) {
    long storedSum = 0;
    long unsignedSum = 0;
    long signedSum = 0;

    int digits = 0;
    boolean seenNonZero = false; // Flag to track if non-zero digits have been seen
    for (int i = 0; i < header.length; i++) {
        byte b = header[i];
        if (CHKSUM_OFFSET <= i && i < CHKSUM_OFFSET + CHKSUMLEN) {
            if ('0' <= b && b <= '7' && (digits < 6 || seenNonZero)) {
                storedSum = storedSum * 8 + b - '0';
                if (b != '0') { // If a non-zero digit is encountered
                    seenNonZero = true;
                }
                digits++;
            }
            b = ' ';
        }
        unsignedSum += 0xff & b;
        signedSum += b;
    }
    return storedSum == unsignedSum || storedSum == signedSum;
}

public static boolean verifyCheckSum(byte[] header) {
    long storedSum = 0;
    long unsignedSum = 0;
    long signedSum = 0;

    int digits = 0;
    boolean foundNonZero = false; // flag to indicate if non-zero digit was found
    for (int i = 0; i < header.length; i++) {
        byte b = header[i];
        if (CHKSUM_OFFSET <= i && i < CHKSUM_OFFSET + CHKSUMLEN) {
            if ('0' <= b && b <= '7' && digits < 6) {
                if (b != '0') { // check for non-zero digit
                    foundNonZero = true;
                }
                if (foundNonZero) {
                    storedSum = storedSum * 8 + b - '0';
                    digits++;
                }
            }
            b = ' ';
        }
        unsignedSum += 0xff & b;
        signedSum += b;
    }
    return storedSum == unsignedSum || storedSum == signedSum;
}

public static boolean verifyCheckSum(byte[] header) {
    long storedSum = 0;
    long unsignedSum = 0;
    long signedSum = 0;

    int digits = 0;
    for (int i = 0; i < header.length; i++) {
        byte b = header[i];
        if (CHKSUM_OFFSET  <= i && i < CHKSUM_OFFSET + CHKSUMLEN) {
            if ('0' <= b && b <= '7') {
                storedSum = storedSum * 8 + b - '0';
                digits++;
            } else if (digits > 0) {
                digits = 6; // Reset to 6 if a non-octal digit is encountered after valid octal digits
            }
            b = ' ';
        }
        unsignedSum += 0xff & b;
        signedSum += b & 0xFF; // Ensure b is treated as an unsigned byte
    }
    return storedSum == unsignedSum || storedSum == signedSum;
}
